class TvGuideItem {
  TvGuideItem({
      List<TvGuideDetails>? movieDetails,
      num? page,}){
    _movieDetails = movieDetails;
    _page = page;
}

  TvGuideItem.fromJson(dynamic json) {
    if (json['movie_details'] != null) {
      _movieDetails = [];
      json['movie_details'].forEach((v) {
        _movieDetails?.add(TvGuideDetails.fromJson(v));
      });
    }
    _page = json['page'];
  }
  List<TvGuideDetails>? _movieDetails;
  num? _page;
TvGuideItem copyWith({  List<TvGuideDetails>? movieDetails,
  num? page,
}) => TvGuideItem(  movieDetails: movieDetails ?? _movieDetails,
  page: page ?? _page,
);
  List<TvGuideDetails>? get tvGuideDetails => _movieDetails;
  num? get page => _page;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_movieDetails != null) {
      map['movie_details'] = _movieDetails?.map((v) => v.toJson()).toList();
    }
    map['page'] = _page;
    return map;
  }

}

